import "./App.css";
import Login from "./Pages/MyAccount/Login";
import Register from "./Pages/MyAccount/Register";
import {
  BrowserRouter,
  Routes,
  Route,
} from "react-router-dom";

function App() {
  return (
    <BrowserRouter className="App">
      <Routes>

       <Route path="/regis" element={<Register/>}/>
       <Route path="/SignIn" element={<Login/>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
